import "./InventoryPage.css";

const InventoryPage = () => {

    return (
        <div className="inventoryPage">
            <h1>My Inventory</h1>
            <div className="inventoryTable">
                <table>
                    <tr>
                        <th>Move name</th>
                        <th>Item name</th>
                        <th>Box number</th>
                    </tr>
                </table>
            </div>
        </div>
    )
}

export default InventoryPage;
